import { AgGridVue } from 'ag-grid-vue';
import AddSkin from "./AddSkin.vue";
import Edit from "./Edit.vue";
import CellRendererActions from "./CellRendererActions.vue";
import '@/assets/scss/vuexy/extraComponents/agGridStyleOverride.scss';
export default {
  components: {
    AgGridVue: AgGridVue,
    AddSkin: AddSkin,
    CellRendererActions: CellRendererActions,
    Edit: Edit
  },
  props: {
    totalProbability: Number
  },
  data: function data() {
    return {
      addNewDataSidebar: false,
      addSkinSidebar: false,
      editbar: false,
      sidebarData: {},
      editData: {},
      searchQuery: '',
      // AgGrid
      list: [],
      skinTypeList: [],
      gridApi: null,
      gridOptions: {},
      defaultColDef: {
        sortable: true,
        resizable: true,
        suppressMenu: true
      },
      columnDefs: [{
        headerName: '名称',
        field: 'itemName',
        filter: true
      }, {
        headerName: '饰品价格',
        field: 'price',
        filter: TextTrackCue
      }, // {
      //   headerName: '奖池',
      //   field: 'pool',
      // //   filter: true,
      //   width:120
      // },
      {
        headerName: '指定账户',
        field: 'appoint' //   filter: true

      }, {
        headerName: '操作',
        field: 'rem',
        //   filter: true,
        cellRendererFramework: 'CellRendererActions'
      }],
      total: 0,
      currentPage: 1,
      pageSize: 10,
      totalPages: 0,
      components: {
        CellRendererActions: CellRendererActions
      },
      searchKey: '',
      free_room_id: this.$route.query.id,
      pool: ''
    };
  },
  watch: {
    addSkinActive: function addSkinActive(val) {
      console.log(val);
    },
    currentPage: function currentPage(val) {
      var _this = this;

      _this.currentPage = val;

      _this.getPrizes();
    },
    pageSize: function pageSize(val) {
      var _this = this;

      _this.pageSize = val;

      _this.getPrizes();
    }
  },
  computed: {},
  methods: {
    activeSon: function activeSon() {
      console.log(1111111111111111111111);
    },
    getPrizes: function getPrizes() {
      var _this = this;

      _this.$axios({
        url: "/admin/Free/prizeList",
        method: "post",
        data: {
          free_room_id: _this.free_room_id,
          searchKey: _this.searchKey,
          page: _this.currentPage,
          pageSize: _this.pageSize
        }
      }).then(function (res) {
        // console.log(res)
        _this.list = res.data.data.list;
        _this.pool = res.data.data.pool;
        _this.total = res.data.data.total;
        _this.totalPages = _this.pageTotal(res.data.data.total, _this.pageSize); // console.log( _this.totalPages,_this.total);
      });
    },
    addSkin: function addSkin() {
      var _this = this;

      _this.addSkinSidebar = true;
    },
    editSkin: function editSkin(row) {
      // console.log(222);
      var _this = this;

      _this.editbar = true;
      _this.editData = row.data;
      _this.editData.free_room_id = _this.free_room_id;
    },
    //"总条数"：rowCount，"每页总条数"：pageSize
    pageTotal: function pageTotal(rowCount, pageSize) {
      if (rowCount == null || rowCount == "") {
        return 0;
      } else {
        if (pageSize != 0 && rowCount % pageSize == 0) {
          return parseInt(rowCount / pageSize);
        }

        if (pageSize != 0 && rowCount % pageSize != 0) {
          return parseInt(rowCount / pageSize) + 1;
        }
      }
    },
    updateSearchQuery: function updateSearchQuery(val) {
      // let _this = this;
      // _this.searchKey = val;
      // _this.getPrizes();
      this.gridApi.setQuickFilter(val);
    }
  },
  mounted: function mounted() {
    this.gridApi = this.gridOptions.api;
    this.getPrizes();
  },
  created: function created() {}
};
